import React from 'react';

const HomePage = ({ user }) => (
  <div>
    <h2>Домашняя страница</h2>
    <p>Привет, {user.name}!</p>
    {/* Здесь вы можете добавить дополнительную информацию о пользователе */}
  </div>
);

export default HomePage;
